import './App.css';
import ListPokemon from './Components/ListPokemon.js';
import PokemonDetails from './Components/PokemonDetails';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

class App extends Component {
  render() {
    return (
      <div className="App">
        <ListPokemon />
      </div>
    );
  }
}

export default App;
